import React, {Component} from 'react';
import {Col, Row} from 'reactstrap';

// style
import './Credits.scss';

const people = [
  {
    name: "Naveen Kharwar",
    url: "https:\/\/naveenkharwar.com",
    description: "A freelance graphic designer, Web/WordPress developer and a geek.",
    image: require("./images/naveen.jpeg"),
    twitter: "https:\/\/www.twitter.com\/naveenkharwar0",
    github: "https:\/\/github.com\/naveenkharwar",
    email: "naveen9198@gmail.com",
    id: '1'
  },

]

class Credits extends Component{
  render() {
    return (
      <div >
        <h4 className="credits">CREDITS FOR THIS PROJECT</h4>
        <div className="container-fluid">
        <Row>
          <div className="text-center">
        {
          people.map( person =>
            <div key={person.id}>
              <Col sm="12" md="6" lg="4" id="image">
                <a href={person.url}><img className="img" src={person.image} alt="Git Commands" /></a>
                <hr />
                <h3>{person.name}</h3>
                 <p>{person.description}</p>
                   <p>
                       <a target="_blank" href={person.twitter}><i className="icons fab fa-twitter"></i></a>
                       <a target="_blank" href={person.github}><i className="icons fab fa-github"></i></a>
                       <a target="_blank" href={"mailto:" + person.email}><i className="icons fas fa-envelope"></i></a>
                   </p>
                   <hr />
              </Col>
            </div>
          )
        }
        </div>
      </Row>
      </div>
      </div>
    );
  }
}

export default Credits;
